import { fromJS } from 'immutable';
import * as constants from './constants';

const defaultState = fromJS({
	title: "BIRD'S PERFECT BAKED POTATOES",
	content: "<img src='https://img.sndimg.com:443/food/image/upload/w_560,h_315,c_fill,fl_progressive,q_80/v1/img/recipes/28/76/36/pic4DqjoE.jpg'>"
})

export default (state = defaultState, action) => {
	switch(action.type) {
		default :
			return state;
	}
}
